import React, { Component } from 'react'
import {MDBRow, MDBCol, MDBBtn} from "mdbreact"

class index extends Component {
  render() {
    return (
      <div>
        <MDBRow>
          <MDBCol sm="4">

          </MDBCol>
        </MDBRow>
        <MDBRow color="b">
          <p>Surnet Telecom  &copy; {new Date().getFullYear()}</p>
        </MDBRow>
      </div>
    )
  }
}

export default index
